import React from "react";

class Card extends React.Component {
    constructor(prosp){
        super(props);

        this.state = {
            result: this.props.result
        }
    }

    render() {
        let { result } = this.state;

        return <p>{ result.nombres.raw +" "+ result.apellidos.raw }</p>;
    }
  }

export default Card;
